import { createSlice } from "@reduxjs/toolkit";

const initialState = {
    users: []
}

const usersList = createSlice({
    name: "usersList",
    initialState,
    reducers: {
        getData : function(state,actions){
            state.users = actions.payload
        }

    }
})

export const {getData} = usersList.actions
export default usersList.reducer
